import { useEffect,useState } from "react";

const BookList = () => {
     let [book,setBook]=useState([])

     useEffect(()=>{
        let fetchData= async()=>{
            let response= await fetch('')
            let data= await response.json()
            setBook(data)
        }
        fetchData()
     },[])


    return ( 
        <div className="booklist">
            <h1>Book List</h1>
        </div>

     );
}
 
export default BookList;
